script: |
  super -f text -I q5032.spq | sort > q5032.out

inputs:
  - name: q5032.spq
    data: |
      SELECT DISTINCT + ( col2 ) AS col0 FROM tab0 (FORMAT parquet) cor0 WHERE + col1 IN ( + col2 * + 65 * + CAST ( NULL AS INTEGER ) * - 74, col2 );
  - name: tab0

outputs:
  - name: q5032.out
    data: |
